import { react, Component, Fragment} from 'react'
import { Routes, Route, BrowserRouter as Router } from 'react-router-dom'
import login from './pages/login'

class App extends Component{
  render(){
	  return(			
			<Fragment>
			 <Routes>	
			   <Route path= '/login' component = {login} />			
			   <h2>ru run</h2>
			 </Routes>	
			</Fragment>
		)
	}
}

export default App
